import React from 'react';

const Card = (props) => {
	return (
			<div className='tc bg-light-blue dib br3 pa3 ma2 grow bw2 shadow-5'>
				<img alt='photo' src ='https://robohash.org/4?set=set4'/>
				<div>
					<h2>{props.name}</h2>
					<p>{props.email}</p>
				</div>
			</div>
		);
}

export default Card;
